import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import Navbar from "./components/Navbar";
import Login from "./pages/Login";
import AdminDashboard from "./pages/AdminDashboard";
import StudentDashboard from "./pages/StudentDashboard";
import LabAssistantDashboard from "./pages/LabAssistantDashboard";
import "./App.css";

function App() {
  const [user, setUser] = useState(null);

  const handleLogin = (userData) => {
    setUser(userData);
  };

  return (
    <Router>
      <Navbar user={user} />
      <Routes>
        <Route path="/" element={<Login onLogin={handleLogin} />} />
        <Route
          path="/admin"
          element={user?.role === "Admin" ? <AdminDashboard user={user} /> : <Navigate to="/" />}
        />
        <Route
          path="/student"
          element={user?.role === "Student" ? <StudentDashboard user={user} /> : <Navigate to="/" />}
        />
        <Route
          path="/lab"
          element={user?.role === "LabAssistant" ? <LabAssistantDashboard user={user} /> : <Navigate to="/" />}
        />
      </Routes>
    </Router>
  );
}

export default App;
